-- Switch to the system (aka master) database
USE master;
GO

-- Delete the assessment Database (IF EXISTS)
IF EXISTS(SELECT * FROM master.sys.databases WHERE name='assessment')
DROP DATABASE assessment;
GO

-- Create a new assessment Database
CREATE DATABASE assessment;
GO

-- Switch to the assessment Database
USE assessment;
GO

create table carts (
	id int IDENTITY(1,1) PRIMARY KEY,
	username VARCHAR(50),
	cookie_value VARCHAR(40),
	created DATE
);
SET IDENTITY_INSERT carts ON;


SET IDENTITY_INSERT carts OFF;

create table items (
	id int IDENTITY(1,1) PRIMARY KEY,
	cart_id INT,
	name VARCHAR(255),
	weight INT,
	added DATE
);
SET IDENTITY_INSERT items ON;


SET IDENTITY_INSERT items OFF;
